import React from 'react';
import ReactDOM from 'react-dom';
import Header from './Header';
const root = document.getElementById('root');

function App () { 
    return(<>
        <Header />
        <div style={{alignSelf: "center", margin: "0 auto"}}>
            <h1>Testing</h1>
        </div>
    </>)
}

ReactDOM.render(<App />, root)
